import React from 'react';
import Header from '../components/Header';
import Sidebar from '../components/Sidebar';
import Dashboard from '../components/Dashboard';
import './Home.css';

const Home: React.FC = () => {
    return (
        <div className="home-container">
            <Header />
            <div className="main-content">
                <Sidebar />
                <Dashboard />
            </div>
        </div>
    );
};

export default Home;
